VISION

    * To provide a Christian music format as an alternative to what currently exists in Fredericton;

    * To provide spoken word programming that will result in the participation of people in their faith;

    * To encourage unity, fellowship and respect among the wide diversity of churches in the Fredericton area;

    * To provide a showcase for local, regional and national Christian music artists.

    * To provide a forum for community awareness through interviews, information exchange, and public service announcements regarding local and national issues.
